const PROCESSED_MOCK_ROUTES = MOCK_ROUTES.map(r => ({
    ...r,
    longName: r.shortName,
    polylines: r.polylines as unknown as [LatLng[], LatLng[]],
    type: r.type as unknown as TransitType,
    vehicles: r.vehicles.map(v => ({
        ...v,
        directionId: 0 as 0 | 1,
        occupancyStatus: 0,
        routeId: `mock_routeId_${r.shortName}`,
        shortName: r.shortName,
        snapBearing: v.bearing,
        snapDeviation: 0,
        snapPosition: v.position,
        vehicleId: `mock_vehicleId_${v.position.lat}_${v.position.lng}`,
    })),
}));

(async () => {
    let listenSocket: us_listen_socket;

    process.on("SIGINT", () => {
        logger.info("Caught interrupt signal");
        uWS.us_listen_socket_close(listenSocket);
        process.exit();
    });

    process.on("unhandledRejection", err => {
        logger.error("unhandledRejection:", err);
    });

    process.on("uncaughtException", err => {
        logger.error("uncaughtException:", err);
    });

    const app = C.useSSL ? uWS.SSLApp(C.ssl) : uWS.App();

    app.ws("/v1/websocket", {
        ...C.ws.v1.opts,

        compression: C.ws.v1.opts.compression ? SHARED_COMPRESSOR : DISABLED,

        open: ws => {
            ws.subscribe("*");
        },
    });

    app.get("/v1/:route", res => {
        res.writeHeader("Content-Type", "application/json");
        res.writeHeader("Access-Control-Allow-Origin", "*");
        res.end(JSON.stringify({
            status: "success",
            routes: Object.fromEntries(PROCESSED_MOCK_ROUTES.map(r => [r.shortName, r])),
        }));
    });

    app.get("/generate_204", res => {
        res.writeStatus("204 No Content").end();
    });

    const port = C.port || 9001;
    app.listen(port, token => {
        if (token) {
            listenSocket = token;
            logger.info(`Listening to port ${port}`);
        }
    });

    const output = new WSOutput(app);

    setInterval(() => {
        const now = Date.now();

        for (const r of PROCESSED_MOCK_ROUTES) {
            for (const v of r.vehicles) {
                const calculatedLastUpdate = now - (v.timeSinceLastUpdate || 0);

                output.publish("*", {
                    status: "success",
                    route: "live/vehicle",
                    lastUpdatedUnix: calculatedLastUpdate / 1000,
                    lastUpdated: calculatedLastUpdate,
                    ...v,
                });
            }
        }
    }, 1000);
})();
